import React, { useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import MoneyCard from "./Cards/MoneyCard";
import AddTransacGoal from "./Forms/AddTransacGoal";

const Goals = () => {
  let [transactions, setTransactions] = useState([]);

  useEffect(() => {
    getTransactions();
  }, []);

  let getTransactions = async () => {
    let response = await fetch("/api/transactions/");
    let data = await response.json();
    console.log(data);
    setTransactions(data);
  };

  return (
    <div className="mx-0 col-lg-3" style={{ backgroundColor: "" }}>
      <div className="">
        <div className="row justify-content-around">
          <div className="my-2 col-lg-12 col-md-3 col-sm-5">
            <h3>Goals</h3>
          </div>
          <div className="my-2 col-lg-12 col-md-3 col-sm-5">
            <MoneyCard
              saved={"530.00"}
              amount={"850.00"}
              title={"MacBook Air"}
            />
          </div>
          <div className="my-2 col-lg-12 col-md-3 col-sm-5">
            <MoneyCard saved={"5.00"} amount={"75.00"} title={"Nike Cortez"} />
          </div>
          <div className="my-2 col-lg-12 col-md-3 col-sm-5">
            <MoneyCard
              saved={"100.00"}
              amount={"350.00"}
              title={"Gaming Monitor"}
            />
          </div>
          <div className="my-2 col-lg-12 col-md-3 col-sm-5">
            <MoneyCard
              saved={"0.00"}
              amount={"350.00"}
              title={"Gaming Monitor"}
            />
          </div>
          <div
            className="row mt-2 mb-5 col-lg-12 col-md-3 col-sm-5 d-flex justify-content-center"
            style={{ backgroundColor: "" }}
          >
            <AddTransacGoal goal={true} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Goals;
